import React, { useState } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import "../styles/theme.css";

export default function InterviewSetup() {
  const [topic, setTopic] = useState("");

  return (
    <div className="page-container">
      <Navbar />
      <main>
        <h1>Setup Interview</h1>
        <form style={{ maxWidth: "400px", width: "100%" }}>
          <label>Interview Topic</label>
          <input value={topic} onChange={(e) => setTopic(e.target.value)} placeholder="e.g. Data Structures" />

          <label>Duration (minutes)</label>
          <input type="number" placeholder="30" />

          <label>Difficulty</label>
          <select>
            <option>Easy</option>
            <option>Medium</option>
            <option>Hard</option>
          </select>

          <button type="submit" className="primary-btn" style={{ width: "100%" }}>Start Interview</button>
        </form>
      </main>
      <Footer />
    </div>
  );
}
